import{_ as a,c as t,o,U as r}from"./chunks/framework.FhXPyWfz.js";const u=JSON.parse('{"title":"iPaaS常见的名词概念","description":"","frontmatter":{"title":"iPaaS常见的名词概念","date":"2022-08-19T06:35:12.000Z"},"headers":[],"relativePath":"doc/wpdoc/iPaaS常见的名词概念.md","filePath":"doc/wpdoc/iPaaS常见的名词概念.md"}'),e={name:"doc/wpdoc/iPaaS常见的名词概念.md"},n=r('<h2 id="本文主要针对ipaas的一些术语名词进行说明。" tabindex="-1">本文主要针对iPaaS的一些术语名词进行说明。 <a class="header-anchor" href="#本文主要针对ipaas的一些术语名词进行说明。" aria-label="Permalink to &quot;本文主要针对iPaaS的一些术语名词进行说明。&quot;">​</a></h2><h3 id="_1-逻辑组件" tabindex="-1"><strong>1. 逻辑组件</strong> <a class="header-anchor" href="#_1-逻辑组件" aria-label="Permalink to &quot;**1\\. 逻辑组件**&quot;">​</a></h3><p>逻辑组件是，指由玄武丝路iPaaS平台提供的功能组件，完成特定的功能和任务。如条件，迭代器等。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E9%80%BB%E8%BE%91%E7%BB%84%E4%BB%B6.jpg" alt=""></p><h3 id="_2-连接器" tabindex="-1"><strong>2. 连接器</strong> <a class="header-anchor" href="#_2-连接器" aria-label="Permalink to &quot;**2\\. 连接器**&quot;">​</a></h3><p>连接器指对一个系统的对外交互接口的封装，通常由该系统的多个行为组成，能够实现玄武丝路iPaaS平台与各个系统的连接。如玄武AI连接器，智慧100的连接器、数据库连接器等。 连接器是对一组行为（触发行为，执行行为）的包装。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%BF%9E%E6%8E%A5%E5%99%A8-1.png" alt=""></p><h3 id="_3-行为" tabindex="-1"><strong>3. 行为</strong> <a class="header-anchor" href="#_3-行为" aria-label="Permalink to &quot;**3\\. 行为**&quot;">​</a></h3><p>行为是指连接器中所包含的、能完成某些业务任务的行为，分为执行行为、触发行为。如翻拍识别，SKU识别等行为。执行行为通常是对某个资源的包装，而触发行为则定义一个外部调用的接口。</p><h4 id="_1-执行行为" tabindex="-1">1) <strong>执行行为</strong> <a class="header-anchor" href="#_1-执行行为" aria-label="Permalink to &quot;1) **执行行为**&quot;">​</a></h4><p>执行行为用于执行一个应用的接口，一个连接器会有多个执行行为，即完成某项或多项业务任务的行为。例如蒙牛的冰品识别执行行为。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E6%89%A7%E8%A1%8C%E8%A1%8C%E4%B8%BA.png" alt=""></p><h4 id="_2-触发行为" tabindex="-1">2) <strong>触发行为</strong> <a class="header-anchor" href="#_2-触发行为" aria-label="Permalink to &quot;2) **触发行为**&quot;">​</a></h4><p>触发行为用于监听或接收应用的消息，一个连接器仅有一个触发行为，处于连接器的第一个节点，有了触发行为，执行行为才会执行。例如：玄武AI的图片比对触发行为。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A7%A6%E5%8F%91%E8%A1%8C%E4%B8%BA.png" alt=""></p><h3 id="_4-账号类型" tabindex="-1"><strong>4. 账号类型</strong> <a class="header-anchor" href="#_4-账号类型" aria-label="Permalink to &quot;**4\\. 账号类型**&quot;">​</a></h3><p>账号类型指某种应用的账号所需要的信息，用于在添加该应用账号时，生成对应的账号录入界面，即某种应用系统的账号类型。如：微信账号，玄武AI账号等。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%B4%A6%E5%8F%B7%E7%B1%BB%E5%9E%8B.png" alt=""></p><h3 id="_5-应用账号" tabindex="-1"><strong>5. 应用账号</strong> <a class="header-anchor" href="#_5-应用账号" aria-label="Permalink to &quot;**5\\. 应用账号**&quot;">​</a></h3><p>应用账号指连接器中，可用于登录某种应用系统的账号信息，实现玄武丝路iPaaS平台上的连接器，以某种应用系统的账号信息连接上该应用系统。如小王的微信账号，小李的高德地图账号，小王的玄武aPaas账号。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%BA%94%E7%94%A8%E8%B4%A6%E5%8F%B7.png" alt=""></p><h3 id="_6-插件" tabindex="-1"><strong>6. 插件</strong> <a class="header-anchor" href="#_6-插件" aria-label="Permalink to &quot;**6\\. 插件**&quot;">​</a></h3><p>插件指玄武丝路iPaaS平台开发人员使用Java语言编写的，包含了应用的登录，执行等方法的jar包（Java档案文件），是一种压缩文件。例如获取SDK的插件。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E6%8F%92%E4%BB%B6.png" alt=""></p><h3 id="_7-资源" tabindex="-1"><strong>7. 资源</strong> <a class="header-anchor" href="#_7-资源" aria-label="Permalink to &quot;**7\\. 资源**&quot;">​</a></h3><p>插件编写好后，上传注册到玄武丝路iPaaS平台上，就成为了资源；登录的方法注册为链接资源，执行方法注册为执行资源。在玄武丝路iPaaS平台上，用户对资源的选择和使用可以实现个性化配置集成流。</p><h3 id="_8-资源包" tabindex="-1"><strong>8. 资源包</strong> <a class="header-anchor" href="#_8-资源包" aria-label="Permalink to &quot;**8\\. 资源包**&quot;">​</a></h3><p>资源包指同一插件的不同版本，上传注册到玄武丝路iPaaS平台上，所产生的资源的集合。用户在选择资源配置集成流时，可依据业务需要，筛选不同的版本调度相关资源。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%B5%84%E6%BA%90%E5%8C%85-1.png" alt=""></p><h3 id="_9-集成流" tabindex="-1"><strong>9. 集成流</strong> <a class="header-anchor" href="#_9-集成流" aria-label="Permalink to &quot;**9\\. 集成流**&quot;">​</a></h3><p>集成流由一个触发行为和多个执行行为和逻辑组件构成的，能完成特定业务处理流程行为集合。即在玄武丝路iPaaS平台上，用户配置的集成流，能按照用户配置的行为流程，处理特定业务。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E9%9B%86%E6%88%90%E6%B5%81.png" alt=""></p><h3 id="_10-租户" tabindex="-1"><strong>10. 租户</strong> <a class="header-anchor" href="#_10-租户" aria-label="Permalink to &quot;**10\\. 租户**&quot;">​</a></h3><p>玄武丝路iPaaS平台租户是指企业租户，即注册使用玄武丝路iPaaS平台的企业。</p><h3 id="_11-使用者" tabindex="-1"><strong>11. 使用者</strong> <a class="header-anchor" href="#_11-使用者" aria-label="Permalink to &quot;**11\\. 使用者**&quot;">​</a></h3><p>玄武丝路iPaaS平台用户是指实际使用平台的用户，即企业中，使用玄武丝路iPaaS平台的不同员工。</p><h3 id="_12-私有" tabindex="-1"><strong>12. 私有</strong> <a class="header-anchor" href="#_12-私有" aria-label="Permalink to &quot;**12\\. 私有**&quot;">​</a></h3><p>指某个数据属于指定的租户，其他的租户不能访问和使用。目前由租户管理员新建的数据（帐号类型，资源包，连接器）都默认是私有的。对玄武丝路iPaaS平台租户而言，所有的集成流和连接都默认是私有的。</p><h3 id="_13-公有" tabindex="-1"><strong>13. 公有</strong> <a class="header-anchor" href="#_13-公有" aria-label="Permalink to &quot;**13\\. 公有**&quot;">​</a></h3><p>指所有租户都能访问和使用的数据。</p><h3 id="_14-参数列表" tabindex="-1"><strong>14.参数列表</strong> <a class="header-anchor" href="#_14-参数列表" aria-label="Permalink to &quot;**14.参数列表**&quot;">​</a></h3><p>参数列表用于显示和选择当前节点所有可用的环境参数。节点的环境参数来源于，当前节点之前的节点的输出参数，主要包含：系统参数，全局参数节点参数，参数列表根据节点进行分组。<br><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%8F%82%E6%95%B0%E5%88%97%E8%A1%A8.png" alt=""></p>',33),i=[n];function s(h,c,l,p,d,_){return o(),t("div",null,i)}const m=a(e,[["render",s]]);export{u as __pageData,m as default};
